--  DDL for Trigger TRG_INSERT_USUARIO
--------------------------------------------------------

  CREATE OR REPLACE TRIGGER "SEMAD"."TRG_INSERT_USUARIO" 
AFTER  INSERT  ON USUARIO 
REFERENCING 
 NEW AS NEW
 OLD AS OLD
FOR EACH ROW

begin
  insert
    into DDL_CACHE (ID_DDL, TX_DDL, CS_ERRO, CS_COMPLETA)
    values (S_DDL_CACHE.nextval, 'CREATE USER '|| :NEW.TX_LOGIN ||' IDENTIFIED BY '|| :NEW.TX_LOGIN ||' DEFAULT TABLESPACE PMM_DATA TEMPORARY TABLESPACE TEMPORARYDATA', 0, 0);
  insert
    into DDL_CACHE (ID_DDL, TX_DDL, CS_ERRO, CS_COMPLETA)
    values (S_DDL_CACHE.nextval, 'GRANT XPTO_CONNECT TO '|| :NEW.TX_LOGIN, 0, 0);
end TRG_INSERT_USUARIO;

/
ALTER TRIGGER "SEMAD"."TRG_INSERT_USUARIO" ENABLE;
--------------------------------------------------------
--  DDL for Trigger TRG_DELETE_USUARIO
--------------------------------------------------------

  CREATE OR REPLACE TRIGGER "SEMAD"."TRG_DELETE_USUARIO" 
  after delete on USUARIO
  for each row





begin
  insert
    into DDL_CACHE (ID_DDL, TX_DDL, CS_ERRO, CS_COMPLETA)
    values (S_DDL_CACHE.nextval, 'DROP USER '|| :OLD.TX_LOGIN, 0, 0);
end TRG_DELETE_USUARIO;

/
ALTER TRIGGER "SEMAD"."TRG_DELETE_USUARIO" ENABLE;
--------------------------------------------------------
--  DDL for Trigger TRG_UPDATE_USUARIO
--------------------------------------------------------

  CREATE OR REPLACE TRIGGER "SEMAD"."TRG_UPDATE_USUARIO" 
  before update on usuario  
  for each row





begin
  if :NEW.TX_LOGIN <> :OLD.TX_LOGIN then
    raise_application_error(-20000, 'O login do usuario n?o pode ser alterado!', FALSE);
  end if;
end TRG_UPDATE_USUARIO;

/
ALTER TRIGGER "SEMAD"."TRG_UPDATE_USUARIO" ENABLE;
